package org.runejs.whitelabel;

import java.util.Base64;

import org.runejs.client.cache.media.ImageRGB;
import org.runejs.client.input.MouseHandler;

public class Images {
    private static ImageRGB logo;

    private static boolean setup = false;

    public static ImageRGB GetPart(String part) {
        if (!Images.setup) {
            Images.CreateParts();
        }
        switch (part) {
            case "logo":
                return logo;

        }
        return logo;
    }

    private static void CreateParts() {
        String logo = "";

        Images.logo = new ImageRGB(Base64.getDecoder().decode(logo), MouseHandler.gameCanvas);

        Images.setup = true;
    }

}

